#import "AppDelegate.h"
#import "TFHpple.h"
#import "AFNetworking.h"
#import "Base64.h"

@implementation AppDelegate

- (BOOL)application:(UIApplication *)application didFinishLaunchingWithOptions:(NSDictionary *)launchOptions
{
    NSMutableString *log = [NSMutableString new];
    __block int j = 0;
    for (int page = 1; page < 85; page++) {
        AFHTTPRequestOperationManager *manager = [AFHTTPRequestOperationManager manager];
        manager.responseSerializer = [AFHTTPResponseSerializer new];
        NSDictionary *parameters = @{@"__EVENTTARGET": @"ctl00$ContentPlaceHolder1$anp",
                                     @"__EVENTARGUMENT": @(page),
                                     @"__VIEWSTATE": @"",
                                     @"__VIEWSTATEGENERATOR": @"8A9F8A8E",
                                     @"__EVENTVALIDATION": @"/wEWAwKOxYyXCALjiMfxCgKb69XMB7husgRM4FAZGhSjBwN17tKPoUYj",
                                     @"ctl00$inputtit": @"请输入您的品牌和机型,看看您的宝贝还值多少钱？",
                                     @"ctl00$ContentPlaceHolder1$anp_input": @"1",
                                     @"hiddenInputToUpdateATBuffer_CommonToolkitScripts": @"1"};
        [manager POST:@"http://www.yifone.com/prolist.aspx?fid=93" parameters:parameters success:^(AFHTTPRequestOperation *operation, id responseObject) {
            TFHpple *doc      = [[TFHpple alloc] initWithHTMLData:responseObject];
            NSArray *elements = [doc searchWithXPathQuery:@"//div[@id='ctl00_ContentPlaceHolder1_divY']/ul/li/a"];
            for (int i = 0; i < [elements count]; i++) {
                TFHppleElement *e = [elements objectAtIndex:i];
                NSString *pid = [[[e objectForKey:@"href"] stringByDeletingPathExtension] stringByReplacingOccurrencesOfString:@"prodetails-" withString:@""];
                NSString *name = nil;
                for (TFHppleElement *t in e.children) {
                    if ([[t tagName] isEqualToString:@"img"]) {
                        name = [[t objectForKey:@"alt"] stringByReplacingOccurrencesOfString:@"手机回收" withString:@""];
                        break;
                    }
                }
                j++;
                NSString *URL = [NSString stringWithFormat:@"http://www.yifone.com/NewASHX/getQybProPrice.ashx?clid=24,73,74,57,81,39,17,27,85,64,13,78,88,91,10,34,&pid=%@", pid];
                [manager GET:URL parameters:nil success:^(AFHTTPRequestOperation *operation, id responseObject) {
                    NSString *price = [[NSString alloc] initWithData:responseObject encoding:NSUTF8StringEncoding];
                    [log appendString:name];
                    [log appendString:@";"];
                    [log appendString:price];
                    [log appendString:@"\n"];
                    j--;
                    if (j == 0) {
                        int a = 0;
                        a++;
                    }
                } failure:^(AFHTTPRequestOperation *operation, NSError *error) {
                    j--;
                    if (j == 0) {
                        int a = 0;
                        a++;
                    }
                    NSLog(@"Error: %@", error);
                }];
            }
        } failure:^(AFHTTPRequestOperation *operation, NSError *error) {
            NSLog(@"Error: %@", error);
        }];
    }
    dispatch_async(dispatch_get_global_queue(DISPATCH_QUEUE_PRIORITY_DEFAULT, 0), ^{
        for (int t = 0; t < 10000000; t++) {
            sleep(1);
        }
    });
    self.window = [UIWindow new];
    [self.window makeKeyAndVisible];
    return YES;
}

@end
